      <text id="74" justification="0" size="4" underlined="false">
        <text>Collection of output streams, for
PubSub writing only.
E.g. one user&apos;s message
will be delivered to other members
of the chat on an outputstream
contained in pubsub.
Each outputstream individually is
synchronized when writing, so
that multiple PubSub message
delivery workers don&apos;t try to
write at the same time.</text>
      </text>
      <color id="75">
        <red>255</red>
        <green>228</green>
        <blue>181</blue>
        <alpha>255</alpha>

      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="80" justification="0" size="4" underlined="false">
        <text>Client handlers containing
sockets that the server reads
client requests on or responds
to those requests with.
E.g. A user sends a message
to this socket, or requests the
friend list to this socket.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
    <NoteNode id="81">

      <location class="Point2D.Double" id="83" x="530.0" y="500.0"/>
      <id id="84" value="1d4ba2bb-0c36-4bef-9869-74aed6dedb9a"/>
      <revision>1</revision>
      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="85" justification="0" size="4" underlined="false">
        <text>Thread-safe object that can
be called from many client
handlers at once.
All interactions (get, set, etc.)
with database are called on
this interfacing object, which
communicates to the store
on a thread-safe message
queue.
A client requests database
operations here, and the
interface returns a Future
right away.
The Future and request are
passed to the store, which
fulfills the Future in its own
thread.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
    <NoteNode id="86">
      <children id="87"/>
      <location class="Point2D.Double" id="88" x="710.0" y="500.0"/>
      <id id="89" value="61385001-5e0b-4a16-a385-141389984a5a"/>
      <revision>1</revision>
      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="90" justification="0" size="4" underlined="false">
        <text>Single threaded object
which contains all the
(non-thread-safe) data
structures.
Infinite loop of popping
requests off the queue
and completing their
associated Futures.
If a PubSub command,
is executed, a job is
submitted to the PubSub
worker pool to be delivered.</text>
      </text>
      <color reference="75"/>
    </NoteNode>
    <NoteNode id="91">
      <children id="92"/>
      <location class="Point2D.Double" id="93" x="890.0" y="500.0"/>

      <revision>1</revision>
      <backgroundColor reference="72"/>
      <borderColor reference="73"/>
      <textColor reference="73"/>
      <text id="95" justification="0" size="4" underlined="false">
        <text>Executor (FixedThreadPool)
which receives values that
have been published to
deliver to subscribers.
Like ReDuber, the job is
submitted and the function
returns right away, while the
operation is queued for later
execution in another thread</text>
      </text>
      <color reference="75"/>
    </NoteNode>

      <textColor reference="73"/>
      <text id="100" justification="0" size="4" underlined="false">
        <text>java.util.concurrent.CompletableFuture&lt;T&gt;
object that represents a value
with type T that does not exist
yet. one thread can wait on the
future&apos;s .get() method, which
blocks until another thread calls
the future&apos;s .complete(T result)
method.</text>
      </text>
      <color reference="75"/>
